import './App.css';
import {BrowserRouter, Routes, Switch} from "react-router-dom"
import Navbar from './component/Navbar/Navbar';
import AddBook from './component/Book/AddBook';
import Books from './component/Book/Books';
import Home from './component/Home/Home';

require('react-dom');
window.React2 = require('react');
console.log(window.React1 === window.React2);


function App() {
  console.log(BrowserRouter.Switch) ;
  return (    
    <BrowserRouter>
    <Navbar/>    
    <Switch> 
          <Routes exact path='/' component={Home} />  
          <Routes exact path='/books' component={Books} />
          <Routes exact path='/addbook' component={AddBook} />     
     </Switch> 
    </BrowserRouter>   

  );
}

export default App;
